import Product from "./ShowName";

function App() {
  return (
    <>
      <Product stock={true} name="product1" price={100}/>
      <Product stock={true} name="prod" price={150}/>
      <Product stock={true} name="" price={200}/>
      <Product stock={true} name="" price={300}/>
    </>
  );
}

export default App;
